import {createSlice} from '@reduxjs/toolkit'

// appApi
import appApi from '../services/appApi'

const initialState=null;

export const userSlice=createSlice({
    name:'user',
    initialState,
    reducers:{
        logout:()=>initialState,
    }, 
    
})

export const {logout} =userSlice.actions; 

export default userSlice.reducer;
